// src/components/Experience.js
import React from 'react';
import Timeline from './Timeline';

const Experience = () => {
  const experiences = [
    {
      company: "Bachelor of technology in Computer Science",
      role: "R.V.R & J.C College of Engineering",
      duration: "July 2016 - Aug 2020",
      description: "Worked on various projects using Java, JavaScript, MySQL, and IBM BPM."
    },
    {
      company: "Software Engineer Intern",
      role: "Incline Inventions Pvt. Ltd., Hyderabad, India",
      duration: "May 2019 - July 2019",
      description: "Worked on various projects using Java, JavaScript, MySQL, and IBM BPM."
    },
    {
      company: "Software Engineer",
      role: "Tata Consultancy Services, Bangalore, India",
      duration: "Oct 2020 - Nov 2022",
      description: "Worked on various projects using Java, JavaScript, MySQL, and IBM BPM."
    },
    {
      company: "Master's in Computer Science",
      role: "University of North Carolina at Charlotte",
      duration: "Jan 2023 - Present",
      description: "Pursuing a Master's degree with a focus on Data Science, Machine Learning and Deep Learning."
    }
    // Add more experiences here
  ];

  return (
    <section className='education section' id='education'>
      <div className="timeline__container container grid">
      <h2 className='section__title'>Education</h2>
      <Timeline experiences={experiences} />
      </div>
    </section>
  );
};

export default Experience;
